import { useEffect, useState } from "react";

interface Props {}

const HomePage = (props: Props) => {
  const [images, setImages] = useState([]);

  useEffect(() => {
    fetch(
      "https://api.nasa.gov/planetary/apod?api_key=DJnbcPU0nmH4c9DUejNgqxVpFh8wB61Jo8RiHeLc&start_date=2024-08-23&end_date=2024-08-30"
    )
      .then((response) => response)
      .then((e) => e.json())
      .then((e) => setImages(e));
  }, []);

  return (
    <div>
      <p>This is the Home Page</p>
      {/* {images.map((image) => (
        <li>{image}</li>
      ))} */}
    </div>
  );
};

export default HomePage;
